import React from 'react';
const Techonologies = () =>
{
    return (
        <div>
            <h4>Привет, сейчас ты можешь ознакомиться с полным списком ЯП</h4>
            <ul>
                <li>C#</li>
                <li>C</li>
                <li>C++</li>
            </ul>
        </div>
    )
};
export default Techonologies;
